import React from "react";
import { useParams, Link } from "react-router-dom";

function Prod() {
  const { categoryName } = useParams();

  // Вместо этого можно выполнить запрос на сервер, чтобы получить соответствующие товары на основе categoryName

  const products = [
    { id: 1, name: "Товар 1" },
    { id: 2, name: "Товар 2" },
    { id: 3, name: "Товар 3" },
  ];
  if (!["phones", "laptops", "tablets"].includes(categoryName)) {
    return <p>Недопустимая категория: {categoryName}</p>;
  }
  return (
    <div>
      <h2>Страница категории: {categoryName}</h2>
      <ul>
        {products.map((product) => (
          <li key={product.id}>asd</li>
        ))}
      </ul>
    </div>
  );
}

export default Prod;
